script: |
  super -f text -I q8583.spq | sort > q8583.out

inputs:
  - name: q8583.spq
    data: |
      SELECT DISTINCT 36 + col1 * ( + cor0.col1 ) * col1 + cor0.col1 / cor0.col2 AS col1 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q8583.out
    data: |
      1036
      17612
      2233
